import React from "react";
import {Component} from "react";
import {Route,HashRouter,NavLink} from "react-router-dom";

class Main extends Component {
    render()
    {
        return(
            <HashRouter>
                <div>
                    <h1>OnePlace Telugu Christian Bible Resources</h1>
                    <ul>
                        <li>Oneplace Telugu</li>
                        <li>Andhra Kristava Keerthanalu</li>
                        <li>My Daily Bread</li>
                    </ul>

                </div>
            </HashRouter>
        );
    }

}

export default Main;
